import { Options } from "vue-class-component";
import ComponentBase from "../Common/ComponentBase";

@Options({})
export default class TestComponent extends ComponentBase {
  /** テストメッセージ */
  private testMsg = "";

  /**
   * テストボタン押下処理
   *
   * @param e
   */
  private testButtonClick(e: Event) {
    this.testMsg = this.testMsg === "" ? "★" : "";
  }
}
